
function generate_pdf_project() {

    const form = document.getElementById('actualizar');
    // Usamos el namespace UMD (importante si lo usas con CDN).
    const { jsPDF } = window.jspdf;

    const doc = new jsPDF({
        orientation: "portrait", // vertical.
        unit: "mm",              // unidades en mil√≠metros.
        format: [375, 530] // ancho x alto en mm (oficio).
    });

    // Agregamos una imagen (puede ser base64 o URL convertida a base64).
    const imgBackground = "";
    doc.addImage(imgBackground, "PNG", 0, 0, 375, 530);

    doc.setFont("times", "bold");
    doc.setFontSize(30);
    doc.setTextColor(0, 0, 0);

    doc.text(`<< ${find_2('nombre').value.toUpperCase()} >>`, 188, 97, { align: "center" });

    doc.setFont("times", "normal");
    doc.setFontSize(16);
    doc.setTextColor(0, 0, 0);

    let ubicacion = doc.splitTextToSize(find_2('ubicacion').value, 100);
    let ubicacionUpperCase = ubicacion.map(cadena => cadena.toUpperCase())

    doc.text(`${find_2('customer_id').value.toUpperCase()}`, 70, 132, { align: "left" });
    doc.text(`${find_2('customer_status').value.toUpperCase()}`, 70, 141, { align: "left" });
    doc.text(ubicacionUpperCase, 70, 151, { align: "left" });
    doc.text(`${find_2('razon_social').value.toUpperCase()}`, 70, 174, { align: "left" });

    doc.text(`${find_2('id').value.toUpperCase()}`, 50, 210, { align: "left" });
    doc.text(`${find_2('sitio').value.toUpperCase()}`, 50, 220, { align: "left" });
    doc.text(`${find_2('fecha_creacion').value.toUpperCase()}`, 107, 230, { align: "left" });
    doc.text(`${find_2('fecha_limite').value.toUpperCase()}`, 75, 239, { align: "left" });
    doc.text(`${find_2('estimado_tiempo').value.toUpperCase()}`, 90, 248, { align: "left" });
    doc.text(`$ ${Number(find_2('monto_cobrar').value).toLocaleString("es-MX")} MXN`, 85, 258, { align: "left" });
    doc.text(`${find_2('status').value.toUpperCase()}`, 90, 268, { align: "left" });

    doc.setFontSize(13);

    doc.text(`$ ${Number(find_2('monto_est_vtc_alimentos').value).toLocaleString("es-MX")} MXN`, 75, 333, { align: "left" });
    doc.text(`$ ${Number(find_2('monto_est_vtc_tras_local').value).toLocaleString("es-MX")} MXN`, 120, 333, { align: "left" });
    doc.text(`$ ${Number(find_2('monto_est_vtc_tras_externo').value).toLocaleString("es-MX")} MXN`, 160, 333, { align: "left" });
    doc.text(`$ ${Number(find_2('monto_est_vtc_com_bancaria').value).toLocaleString("es-MX")} MXN`, 205, 333, { align: "left" });
    doc.text(`$ ${Number(find_2('monto_est_vtc_gasolina').value).toLocaleString("es-MX")} MXN`, 245, 333, { align: "left" });
    doc.text(`$ ${Number(find_2('monto_est_vtc_caseta').value).toLocaleString("es-MX")} MXN`, 285, 333, { align: "left" });
    doc.text(`$ ${Number(find_2('monto_est_vtc_hospedaje').value).toLocaleString("es-MX")} MXN`, 325, 333, { align: "left" });

    doc.setFont("times", "bold");
    doc.setFontSize(30);

    doc.text(`${Number(find_2('estimado_viaticos').value).toLocaleString("es-MX")} MXN`, 275, 368, { align: "left" });

    doc.setFont("times", "normal");
    doc.setFontSize(20);

    let notas = doc.splitTextToSize(find_2('notas').value, 110);
    let notasUpperCase = notas.map(cadena => cadena.toUpperCase())

    doc.text(notasUpperCase, 167, 417, { align: "left" });

    window.open(doc.output("bloburl"), "_blank");
}

function find_2(id) {
    const form = document.getElementById('actualizar');
    return form.querySelector(`#${id}`);
}

function asig_listener_autocomplete_rfc_cliente() {
    document.getElementById('input_find_rfc_cliente').addEventListener('input', function () {
        const query = this.value;
        const sugerencias = document.getElementById('sugerencias_rfc_cliente');

        if (query.length < 1) {
            sugerencias.innerHTML = '';
            return;
        }

        console.log("buscando rfc de clientes...");

        fetch(`/clientes/buscar-rfc?q=${query}`, {
            method: 'GET',
            headers: {
                'X-CSRF-TOKEN': document.querySelector('meta[name="csrf-token"]').content,
                'Accept': 'application/json',
            }
        })
            .then(res => {if(res.ok) { return res.json() } else { throw new Error('Error en la respuesta del servidor') }})
            .then(data => {
                sugerencias.innerHTML = '';
                data.forEach(cust => {
                    const option = document.createElement('option');
                    option.value = cust.id + " - " + cust.razon_social; // ejemplo: id - razon_social
                    sugerencias.appendChild(option);
                });
            }).catch(err => {
                console.warn("Error al buscar RFC de clientes:", err.message);
            });
    });
}

async function get_results_and_show_them_like_buttons(endpoint, concepto) {
    const list = document.getElementById('lista_resultados');
    if (!list.classList.contains('d-none')) list.classList.add('d-none');
    list.innerHTML = ''; // Limpiar resultados previos.
    const form = document.querySelector("form");
    const inputs = form.querySelectorAll("input, select");
    const data = {};

    inputs.forEach(input => {
        data[input.name] = input.value;
    });

    const div_success = document.getElementById("div_mensaje_success");
    const div_error = document.getElementById("div_mensaje_error");

    try {

        if (form.checkValidity()) {

            form.classList.add('was-validated');

            const response = await fetch(endpoint, {
                method: 'POST',
                headers: {
                    'X-CSRF-TOKEN': document.querySelector('meta[name="csrf-token"]').content,
                    'Accept': 'application/json',
                    "Content-Type": "application/json"
                },
                body: JSON.stringify(data)
            });

            const result = await response.json();
            console.log("Respuesta del backend:", result);

            if (response.ok) {
                //Aqu√≠ procesas result que es un array de objetos.
                result.forEach(item => {
                    const li = document.createElement('li');
                    li.className = 'mb-2';
                    const button = document.createElement('button');
                    button.className = 'fw-bold delete-button d-flex justify-content-between align-items-center gap-3 w-100';
                    button.style.fontSize = "1.3rem";
                    button.style.textAlign = "justify";
                    button.style.border = "none";
                    button.style.backgroundColor = "transparent";
                    button.style.cursor = "pointer";
                    button.innerHTML = `<div>${concepto} del empleado ${item.employee_name} el ${item.fecha_dispersion_dia} para el proyecto ${item.project_name}.</div>
                    <img class="imageResponsive mx-0 img-button-delete" src="http://127.0.0.1:8000/img/borrar.png" alt="borrar" style="width: 2rem;">`;
                    button.onclick = function () {
                        if (confirm("¬øEstas seguro de eliminar esta dispersi√≥n? La acci√≥n no podra ser revertida.")) {
                            fetch(`/ge_corte_x_dia_borrar/${item.id}`, {
                                method: 'DELETE',
                                headers: {
                                    'X-CSRF-TOKEN': document.querySelector('meta[name="csrf-token"]').content,
                                    'Accept': 'application/json',
                                }
                            })
                                .then(res => {
                                    if(res.ok) {
                                        div_success.style.visibility = "visible";
                                        div_success.style.opacity = "1";
                                        li.remove();
                                        setTimeout(() => {
                                            div_success.style.visibility = "hidden";
                                            div_success.style.opacity = "0";
                                        }, 2500);
                                    }
                                    else {
                                        div_error.style.visibility = "visible";
                                        div_error.style.opacity = "1";
                                        setTimeout(() => {
                                            div_error.style.visibility = "hidden";
                                            div_error.style.opacity = "0";
                                        }, 3000);
                                    }
                                });
                        }
                    };

                    li.appendChild(button);
                    list.appendChild(li);
                });

                list.classList.remove('d-none');
            }

            else {
                throw new Error(response.message || 'Error en la respuesta del servidor');
            }
        }

    } catch (error) {
        console.error("Error en el fetch:", error);
        alert("Hubo un problema al obtener los datos. Intenta de nuevo.");
    }
}